--
-- Table structure for table `ms_mall_goods`
--

DROP TABLE IF EXISTS `ms_mall_goods`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ms_mall_goods` (
  `goods_id` mediumint(8) unsigned NOT NULL AUTO_INCREMENT,
  `goods_sn` varchar(50) DEFAULT NULL,
  `goods_name` varchar(120) CHARACTER SET utf8 NOT NULL DEFAULT '',
  `small_name` varchar(200) DEFAULT NULL,
  `spec_type` tinyint(1) DEFAULT '1' COMMENT '规格类型 1：单一规格 2：多规格',
  `click_count` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '点击次数',
  `collect_times` int(10) DEFAULT '0' COMMENT '收藏数量',
  `evaluate_count` int(10) DEFAULT '0' COMMENT '评论次数',
  `hpl` float(3,2) DEFAULT '1.00' COMMENT '好评率',
  `brand_id` smallint(5) unsigned NOT NULL DEFAULT '0' COMMENT '品牌id',
  `cost_price` decimal(10,2) DEFAULT '0.00' COMMENT '成本价',
  `market_price` decimal(10,2) DEFAULT '0.00' COMMENT '市场价',
  `shop_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '本店售价',
  `consumption_type` int(1) DEFAULT '1' COMMENT '消费类型 1：现金 ，2：一卷通+现金 3：购物券+现金 ',
  `give_integral` decimal(10,2) DEFAULT '0.00' COMMENT '赠送积分',
  `promote_price` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '促销价',
  `promote_start_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '促销开始时间',
  `promote_end_date` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '促销结束时间',
  `goods_weight` decimal(10,3) unsigned NOT NULL DEFAULT '0.000' COMMENT '商品重量',
  `is_best` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '精品',
  `is_new` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '新品',
  `is_hot` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '热销',
  `is_yushou` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是预售',
  `is_ziti` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否是自提',
  `is_on_sale` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否上架',
  `store_tuijian` tinyint(1) DEFAULT '0' COMMENT '店铺内推荐 0 不推荐 1 推荐',
  `floor_show` tinyint(1) DEFAULT '0' COMMENT '楼层展示',
  `freight_type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '运费类型 1 固定运费 2 使用运费模板',
  `freight` decimal(10,0) DEFAULT '0' COMMENT '运费',
  `keywords` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT 'seo关键词',
  `description` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT 'seo描述',
  `gc_id` int(4) DEFAULT NULL COMMENT '商品分类id',
  `gc_id_path` varchar(20) CHARACTER SET utf8 DEFAULT '0' COMMENT '分类追溯',
  `mid` int(4) unsigned NOT NULL DEFAULT '0' COMMENT '商品模型id',
  `goods_desc` text CHARACTER SET utf8 NOT NULL COMMENT '商品介绍',
  `goods_tag` text CHARACTER SET utf8 COMMENT '商品标签',
  `goods_spec_data` text,
  `sales` int(10) DEFAULT '0' COMMENT '销量',
  `store_id` int(11) DEFAULT '1' COMMENT '店铺id',
  `store_class_id` int(11) DEFAULT '0' COMMENT '店铺分类id',
  `max_buy` int(10) DEFAULT '0' COMMENT '最大购买数量',
  `examine_status` smallint(1) DEFAULT '2' COMMENT '审核状态 1：审核通过  2：未审核 3： 审核不通过',
  PRIMARY KEY (`goods_id`),
  KEY `cat_id` (`mid`),
  KEY `brand_id` (`brand_id`),
  KEY `goods_weight` (`goods_weight`),
  KEY `promote_end_date` (`promote_end_date`),
  KEY `promote_start_date` (`promote_start_date`)
) ENGINE=MyISAM AUTO_INCREMENT=80 DEFAULT CHARSET=gbk COMMENT='商品表';
/*!40101 SET character_set_client = @saved_cs_client */;

