--
-- Table structure for table `ms_mall_order_info`
--

DROP TABLE IF EXISTS `ms_mall_order_info`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `ms_mall_order_info` (
  `order_sn` char(14) NOT NULL,
  `uid` int(10) DEFAULT NULL,
  `receipt_status` int(4) DEFAULT '0' COMMENT '收货状态',
  `shipping_status` int(4) DEFAULT '0' COMMENT '配送状态',
  `pay_status` int(4) DEFAULT '0' COMMENT '支付状态',
  `refund_status` int(4) DEFAULT '0' COMMENT '是否存在退货商品',
  `evaluate_status` int(4) DEFAULT '0' COMMENT '评价状态',
  `consignee` varchar(50) DEFAULT NULL,
  `address` varchar(200) DEFAULT NULL,
  `mobile` varchar(20) DEFAULT NULL,
  `shipping_id` int(10) DEFAULT NULL COMMENT '配送方式id',
  `shipping_sn` varchar(30) DEFAULT NULL COMMENT '运单编号',
  `freight` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `pay_id` int(10) DEFAULT NULL,
  `postscript` varchar(200) DEFAULT NULL,
  `order_time` int(10) DEFAULT NULL COMMENT '下单时间',
  `pay_time` int(10) DEFAULT NULL COMMENT '支付时间',
  `send_time` int(10) DEFAULT NULL COMMENT '发货时间',
  `confirm_time` int(10) DEFAULT NULL COMMENT '成交时间',
  `order_ip` char(15) DEFAULT NULL,
  `store_id` int(11) DEFAULT '0' COMMENT '店铺ID',
  `cash` decimal(10,2) DEFAULT '0.00',
  `integral` int(10) DEFAULT '0',
  `total` decimal(10,2) DEFAULT '0.00' COMMENT '订单总额',
  `yjt` decimal(10,2) DEFAULT '0.00' COMMENT '一卷通',
  `gwq` decimal(10,2) DEFAULT '0.00' COMMENT '购物券',
  `settlement_total` decimal(10,2) DEFAULT '0.00' COMMENT '应结总额',
  `settlement_already` decimal(10,2) DEFAULT '0.00' COMMENT '已经结算',
  `settlement_no` decimal(10,2) DEFAULT '0.00' COMMENT '未结算总额',
  `settlement_status` int(1) DEFAULT '0' COMMENT '结算状态0未结算1结算',
  `settlement_time` int(10) DEFAULT '0' COMMENT '结算时间',
  `is_love` int(1) DEFAULT '0' COMMENT '是否捐款',
  `upgrade` int(1) DEFAULT '0' COMMENT '是否是升级订单',
  `is_exchange` tinyint(1) DEFAULT '0' COMMENT '是否是换货订单',
  PRIMARY KEY (`order_sn`),
  UNIQUE KEY `order_sn` (`order_sn`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='订单表';
/*!40101 SET character_set_client = @saved_cs_client */;

